window.bookSummaryJSON = "<p>&nbsp;It's 2023, and life is not great.</p> <p>Time to go back to 199X.</p> <p>John Chambers is pushing 40. Stuck in his home. Trapped in a dead-end job.</p> <p>Like the great romantic poet Eddie Money, he wants to go back and do it all over.</p> <p>Now, he can.</p> <p>In the virtual world of New Arcadia, John becomes \"Blaze\". Twenty-two years old. Incredible speed and strength. Absolutely zero back pain.</p> <p>On the mean streets of this new retro city, Blaze must use his fists, his wits, and his pager to survive.</p> <p>Only he can save the city. But he has to team up with a gang of other loners to do it.</p> <p>Meanwhile, outside the game pods, New Arcadia's creators race to save the real world.</p> <p>They all have only one more chance to get this right.</p> <p>If you like<i> Ready Player One</i> and if you were alive in the '90s or know someone who was, then you'll love this adventure.</p> <p>Get it now.&nbsp;</p> <p><b>Starring:</b></p> <p>Eric Jason Martin (<i>Heads Will Roll</i>, <i>Bubble</i>)&nbsp;</p> <p>Matthew Mercer (<i>Critical Role</i>)&nbsp;</p> <p>Dave Fennoy (<i>The Walking Dead</i>)&nbsp;</p> <p>Erika Ishii (<i>Cyberpunk 2077</i>)&nbsp;</p> <p>Sam Riegel (<i>Critical Role</i>)&nbsp;</p> <p>Dana Snyder (<i>Aqua Teen Hunger Force</i>)&nbsp;</p> <p>Andy Merrill (<i>Space Ghost: Coast to Coast</i>)&nbsp;</p> <p>and John DiMaggio (<i>Futurama</i>, <i>Gears of War</i>)&nbsp;</p> <p>With Marin Ireland, Scott Brick, Suzanne Elise Freeman, P.J. Ochlan, Tara Sands, Justin Michael, Betsy Sodaro, DC Pierson, Neil Hellegers, Johnny Heller, and Ron Butler.&nbsp;</p> <p>New Arcadia Theme by Lloyd Cole&nbsp;</p> <p>Original Soundtrack by Casey Trela&nbsp;</p> <p>Post Production by Mumble Media&nbsp;</p>"; 
